import React, { useState } from 'react';
import { connect } from 'react-redux';

const Search = ({
    search_products
}) => (
    <div>
        Search
    </div>
);

const mapStateToProps = state => ({
    search_products: state.products.search_products
});

export default connect(mapStateToProps, {})(Search);
